import React from 'react'
import { Card, Button, CardTitle, CardText, Row, Col, Container } from 'reactstrap';

const SurveyInterest = ({interest, setInterest}) => {

  const addInterest = ()=>{
    console.log('addinterest');
  }
  const moveNextPage = ()=>{
    console.log('페이지 이동');
    window.location.replace("/survey/result")
}

  return (
    <div className="survey-interest-wrapper">
            <div className="middle-spacer" id="card-component">
                <Container>
                    <Row className="justify-content-center">
                        <Col md="7" className="text-center">
                            <h4 className="title font-bold">불편하거나 걱정되는 것을 3가지 선택해 주세요.</h4>
                        </Col>
                    </Row>
                </Container>
            </div>
             <div className='select-interest'>
              <Button type="button" onClick={addInterest} className="btn waves-effect waves-light btn-outline-primary">혈관, 혈액순환</Button>
              <Button type="button" onClick={addInterest} className="btn waves-effect waves-light btn-outline-primary">소화, 장</Button>
              <Button type="button" onClick={addInterest} className="btn waves-effect waves-light btn-outline-primary">눈</Button>
              <Button type="button" onClick={addInterest} className="btn waves-effect waves-light btn-outline-primary">간</Button>
              <Button type="button" onClick={addInterest} className="btn waves-effect waves-light btn-outline-primary">뼈, 관절</Button>
              <Button type="button" onClick={addInterest} className="btn waves-effect waves-light btn-outline-primary">항산화</Button>
             </div>
 
            <Button className="next-btn" color="success" onClick={moveNextPage}>결과확인</Button>

        </div>
  )
}

export default SurveyInterest
